class City():
    "A City"
    def __init__(self, d=None):
        self.name = ""
        self.lat = decimal.Decimal(0)
        self.lon = decimal.Decimal(0)
        if d is not None:
            self.name = d["name"]
            if d["lat"]:
                self.lat = decimal.Decimal(d["lat"])
            if d["lon"]:
                self.lon = decimal.Decimal(d["lon"])


class SpecDocs():
    "File Spec Documentation"
    def __init__(self, d=None):
        self.col_name = ""
        self.col_title = ""
        self.col_descr = ""
        if d is not None:
            self.col_name = d["col_name"]
            self.col_title = d["col_title"]
            self.col_descr = d["col_descr"]


class GeoLatLon():
    "A geocoded latitude/longitude location"
    def __init__(self, d=None):
        self.lat = decimal.Decimal(0)
        self.lon = decimal.Decimal(0)
        self.descr = ""
        self.block_code = ""
        self.tract_code = ""
        self.county_code = ""
        self.county_name = ""
        self.state_code = ""
        self.state_abbrev = ""
        self.state_name = ""
        if d is not None:
            if d["lat"]:
                self.lat = decimal.Decimal(d["lat"])
            if d["lon"]:    
                self.lon = decimal.Decimal(d["lon"])
            self.descr = d["descr"]
            self.block_code = d["block_code"]
            self.tract_code = d["tract_code"]
            self.county_code = d["county_code"]
            self.county_name = d["county_name"]
            self.state_code = d["state_code"]
            self.state_abbrev = d["state_abbrev"]
            self.state_name = d["state_name"]


class RevgeoAddr():
    "A reverse geocoded address"
    def __init__(self, d=None):
        self.address = ""
        self.distance = decimal.Decimal(0)
        if d is not None:
            self.address = d["address"]
            if d["distance"]:
                self.distance = decimal.Decimal(d["distance"])


class Client():
    "API Client"

    def __init__(self, username=None, password=None, url_base=None):
        # If these are None, requests will look in .netrc for auth
        self.username = username
        self.password = password
        self.url_base = url_base
        if self.url_base is None:
            self.url_base = URL_BASE


    def get(self, url):
        "Call an API GET endpoint"
        full_url = self.url_base + url
        r = None
        if self.username:
            r = requests.get(full_url, auth=(self.username, self.password))
        else:
            r = requests.get(full_url) # Uses .netrc
        return r.json()
    

    def get_states(self):
        "Get a list of US states"
        j = self.get("/census2010/states")
        states = []
        for d in j:
            states.append(CensusState(d))
        return states


    def get_counties(self, state_code):
        "Get the counties in one state"
        j = self.get("/census2010/counties/" + state_code)
        counties = []
        for d in j:
            counties.append(CensusCounty(d))
        return counties


    def get_tracts(self, state_code, county_code):
        "Get the census tracts in one county"
        j = self.get(
            "/census2010/tracts/{}/{}".format(state_code, county_code))
        tracts = []
        for d in j:
            tracts.append(CensusTract(d))
        return tracts


    def get_blocks(self, state_code, county_code, tract_code):
        "Get the census blocks in one tract"
        j = self.get(
            "/census2010/blocks/{}/{}/{}".format(
                state_code, county_code, tract_code))
        blocks = []
        for d in j:
            blocks.append(CensusBlock(d))
        return blocks


    def get_tract_profile(self, state_code, county_code, tract_code):
        "Get the demographic profile for the census tract"
        j = self.get(
            "/census2010/dp/{}/{}/{}".format(
                state_code, county_code, tract_code))
        dp = TractDemographicProfile(j[0])
        return dp


    def get_basic_county(self, state_code, county_code):
        "Get basic demographics for the county"
        j = self.get(
            "/census2010/sf1basic/state/{}/county/{}".format(
                state_code, county_code))
        bd = BasicDemographics(j[0])
        return bd


    def get_zctas(self, state_code):
        "Get the zctas in one state"
        j = self.get("/census2010/zcta5/" + state_code)
        zctas = []
        for d in j:
            zctas.append(Zcta(d))
        return zctas


    def get_basic_tract(self, state_code, county_code, tract_code):
        "Get basic demographics for the tract"
        j = self.get(
            "/census2010/sf1basic/state/{}/county/{}/tract/{}".format(
                state_code, county_code, tract_code))
        bd = BasicDemographics(j[0])
        return bd


    def get_basic_block(self, state_code, county_code, tract_code, block_code):
        "Get basic demographics for the block"
        j = self.get(
            "/census2010/sf1basic/state/{}/county/{}/tract/{}/block/{}".format(
                state_code, county_code, tract_code, block_code))
        bd = BasicDemographics(j[0])
        return bd


    def get_cities(self, state_abbrev):
        "Get the cities in one state"
        j = self.get("/cities/" + state_abbrev)
        cities = []
        for d in j:
            cities.append(City(d))
        return cities


    def geocode(self, address):
        "Geocode a mailing address"
        j = self.get("/geocode/" + address)
        latlon = GeoLatLon(j)
        return latlon


    def revgeocode(self, lat, lon):
        "Reverse geocode coordinates to find the closest address"
        j = self.get("/revgeocode/{}/{}".format(str(lat), str(lon)))
        return RevgeoAddr(j)


    def get_sf1_docs(self, file_num):
        "Get docs for an SF1 File. 01, 03, 04, 05, 06, 07."
        j = self.get("/census2010/sf1/{}/docs".format(file_num))
        docs = []
        for d in j:
            docs.append(SpecDocs(d))
        return docs


    def get_sf101(self, state_code, county_code, tract_code, block_code):
        "Get data from the 2010 census SF1 file 01"
        j = self.get(
            "/census2010/sf1/01/{}/{}/{}/{}".format(
                state_code, county_code, tract_code, block_code))
        sf = SF101(j[0])
        return sf


